import AboveTheFold from "../Components/AboveTheFold";
import RecentWork from "../Components/RecentWork";
import Contact from "../Components/Contact";
import ToTop from "../Components/ToTop";

export default function Home() {
  return (
    <>
      <ToTop />
      <AboveTheFold />
      <RecentWork />
      <About />
      <Contact no="04" />
    </>
  );
}
